name: send_multiple

# Run this workflow every time a new commit pushed to your repository
on:
  repository_dispatch:
    types: send_multiple

jobs:


  send_0:
    # Name the Job
    name: send_0
    if:  contains(github.event.client_payload.id, ',0,')
    # Set the type of machine to run on
    runs-on: ubuntu-18.04
    timeout-minutes: 120


    steps:
      # Checks out a copy of your repository on the ubuntu-latest machine
      - name: Check out my other private repo
        uses: actions/checkout@v2
        with:
          repository: brokenjade3000/got_auto
          token: ${{ secrets.BK3K_TOKEN }} # `GH_PAT` is a secret that contains your PAT
          path: got_auto      

      - name: set up python 3.6
        uses: actions/setup-python@v2
        with:
          python-version: 3.6

      - name: install packages
        env:
          DEFAULT_BRANCH: main
          MASTER_KEY: ${{ secrets.MASTER_KEY }}
          GOTAUTH: ${{ secrets.GOTAUTH }}
          LOG_TOKEN: ${{ secrets.LOG_TOKEN }}
        run: |
          cd /home/runner/work/pub_hofs/pub_hofs/got_auto
          chmod 775 ./script/install.sh
          ./script/install.sh
      - name: Run send_0
        env:
          DEFAULT_BRANCH: main
          MASTER_KEY: ${{ secrets.MASTER_KEY }}
          GOTAUTH: ${{ secrets.GOTAUTH }}
          LOG_TOKEN: ${{ secrets.LOG_TOKEN }}
          GIT_REPO: ${{ secrets.GIT_REPO }}
        run: |
          pwd
          cd /home/runner/work/pub_hofs/pub_hofs/got_auto/src
          python --version
          sleep 0
          python SentHOF.py ${ github.event.client_payload.x} ${ github.event.client_payload.y } 0 

